import React, { Component } from "react";
//import { Jwt } from "jsonwebtoken";

class GetServers extends Component {
  constructor(props) {
    super(props);
    this.state = {
      servers: [],
      isLoaded: false,
    };
  }

  async componentDidMount() {
    const url = "https://playground.oxylabs.io/api/servers";
    const TOKEN =
      "eyJ1c2VybmFtZSI6Im94eWxhYnMiLCJwYXNzd29yZCI6InBhcnR5YW5pbWFsIiwiYWxnIjoiSFMyNTYifQ.eyJzdWIiOiIxMjM0NTY3ODkwIiwibmFtZSI6IkpvaG4gRG9lIiwiaWF0IjoxNTE2MjM5MDIyfQ.jXcJGj1q1X3Gk1C-CoZlbF1bZwm6aTmWeuF6Axf0_CM";
    const response = await fetch(url, {
      method: "post",
      headers: new Headers({
        "x-access-token": { TOKEN },
        "Content-Type": "application/x-www-form-urlencoded",
      }),
      body: "",
    });
    const data = response;
    console.log(data);
  }

  render() {
    var { isLoaded, servers } = this.state;
    if (!isLoaded) {
      return <div className="p-4 display-6">Loading data from API...</div>;
    } else {
      return (
        <div className="servers">
          <div className="">
            {servers.map((server, index) => {
              return (
                <div key={index}>
                  <div>{server.title}</div>
                </div>
              );
            })}
          </div>
        </div>
      );
    }
  }
}

export default GetServers;
